import React from 'react';
import { NavLink } from 'react-router-dom';

function Navbar(props) {
    
    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-grey" >
        
            <ul className="navbar-nav mr-auto" >
                <li className="nav-item active"><NavLink className="nav-link" to="/" style={{ color: "white" }}>Home</NavLink></li>
                <li className="nav-item active"><NavLink className="nav-link" to="/about" style={{ color: "white" }}>About</NavLink></li>
                <li className="nav-item active"><NavLink className="nav-link" to="/contact" style={{ color: "white" }}>Contact</NavLink></li>
            </ul>
        </nav>
    )
}

export default Navbar
